import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1>Choisissez un utilisateur</h1>
      <Link to="/user/12">
        <button>User 12</button>
      </Link>
      <Link to="/user/18">
        <button>User 18</button>
      </Link>
    </div>
  );
}

export default Home;
